contract Transaction {

    uint256 public mininumUSD = 50;

    function fund() public payable {

        require(msg.value > mininumUSD, "Amount must be greater than 1");

    }

    function getRate(uint256) public view returns(uint256) {
        return mininumUSD;
    }



}

